import React from "react"
import NavBar from "../NavBar"

function Study(){

    return(
        <div>
            <NavBar subLink={`/decks/${deckId}/study`} subLinkName={`Deck ${studyDeck.name}`} currentPage="Study Deck"  />
            <h2>Study {studyDeck.name}</h2>
        </div>
    )
}

export default Study
